import { takeEvery, put, call } from 'redux-saga/effects';
import { getRequestServer_EltypeClass } from '../../store/EltypeClasse/actions/actionEltypeClasse';
import { START_GET_REQUEST_EC } from '../../store/EltypeClasse/types';
import fetchData from '../../functions/fetchData';
import { url_EltypeClasse} from "../../constans/url"


export function* workerStart_GET_RequestServer(){
    
    try {
        const data = yield call(fetchData, url_EltypeClasse);

        yield put(getRequestServer_EltypeClass(data));
  
    } catch (error) {
        alert('workerStart_GET_RequestServer error ', error);
    }
}

export function* watch_EltypeClasse_GET_RequestServer(){
    
    yield takeEvery(START_GET_REQUEST_EC, workerStart_GET_RequestServer)
}
